          <div className="input-group mb-3">
            <input type="text" className="form-control" placeholder="Nome do cargo" />
          </div>

          <div className="input-group mb-3">
            <textarea className="form-control" placeholder="Descrição do cargo"/>
            <button className="btn btn-outline-success" type="button">Adicionar Cargo</button>
          </div>
        </div>
      );
    }
  }
export default DescriptionForm;
